import React from "react";
import { Carousel } from "react-bootstrap";
import image from "../asset/photo_1_2023-03-06_20-11-10.jpg";
import image2 from "../asset/photo_2_2023-03-06_20-11-10.jpg";
import image3 from "../asset/photo_3_2023-03-06_20-11-10.jpg";
const Landing = () => {
  return (
    <div className="lnding">
      <div className="container-fluid">
        {" "}
        <Carousel>
          <Carousel.Item>
            <div className="div"></div><img src={image} />
            <Carousel.Caption>
              <h3>First slide label</h3>
              <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <div className="image">
              {" "}
              <img src={image2} />
            </div>
            <Carousel.Caption>
              <h3>Second slide label</h3>
              <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <div className="image">
              {" "}
              <img src={image3} />
            </div>
            <Carousel.Caption>
              <h3>Third slide label</h3>
              <p>
                Praesent commodo cursus magna, vel scelerisque nisl consectetur.
              </p>
            </Carousel.Caption>
          </Carousel.Item>
        </Carousel>
      </div>
    </div>
  );
};
export default Landing;
